(457, 15, 'IKU1', 'FRS-002', 'program', 'Perpanjangan Anggota Asosiasi Program Studi \"FORTEI\"', 'Kegiatan ini bertujuan untuk memperluas jaringan kerjasama antar sesama program studi teknik elektro diindonesia, sehingga dapat memperoleh informasi terbaru terkait bidang elektro baik dalam bidang penelitian, pengabdian, adapun keuntungan dari menjadi anggota fortei adalah terciptanya sistem kurikulum yang selaras dengan perkembangan ilmu dan teknologi', 'https://fortei.org/v2/pendaftaran-anggota-fortei/', 'april', '1000000', 'Tergabungnya prodi elektro UTS dalam keanggotaan fortei juga mendukung tercapainya IKT yang medukung IKU', NULL, NULL, NULL, '2024'),
(458, 15, 'IKU 5', 'FRS-003', 'program', 'Kuliah Tamu', 'Tujuan kegiatan ini adalah memberikan tambahan wawasan kepada mahasiswa dari praktisi profesional, selain itu juga meningkatkan hubungan kerjasma antara lembaga pendidikan dan DUDI', 'Ruang Multimedia STP', 'april', '1500000', 'Salah satu point dalam akreditasi program studi adalaha dilaksanakannya inimal 2 kali dalam setahun kegiatan kuliah tamu', NULL, NULL, NULL, '2024'),
