(463, 15, 'Persentase mata kuliah yang menggunakan metode pembelajaran pemecahan kasus (case method) atau pembelajaran kelompok berbasis proyek (team based project) sebagai sebagian bobot evaluasi.', 'FRS-008', 'program', 'Lokakarya RPS Case Method (CM) dan Problem Based Learning (PBL)', 'Lokarkarya RPS dengan konsep CM dan PBL bertujuan untuk meningkatkan kualitas  RPS untuk MK pada program studi a di lingkungan Fakultas Rekayasa Sistem sehingga terciptanya komuniatas dosen yang aktif dalam mengembangkan pembelajaran inovatif pada bidang keilmuan masing-masing', 'Luar Kampus', 'mei', '1000000', '', NULL, NULL, NULL, '2024'),
(464, 15, 'Persentase mahasiswa yang mendapatkan prestasi minimal nasional', 'FRS-009', 'program', 'Pendampingan dan pembinaan program kemahasiswaan oleh dosen (1 Tahun)', 'Program pendampingan dan pembinaan program kemahasiswaan oleh dosen di lingkugan FRS bertujuan untuk meningkat kulitas program kemahasiswaan yang diselnggarakan oleh Dikti maupun yang relevan sehingga dapat meningkatkan jumlah kompetisi yang lolos secara nasional (Juara 1, 2, 3, dst)', 'FRS', 'mei', '1500000', '', NULL, NULL, NULL, '2024'),
(465, 15, 'Terimplementasinya sistem penjaminan mutu internal', 'FRS-010', 'program', 'Sosialisasi dan Pendampingan oleh UPMF kepada program studi penginputan bekas SPMI', 'Sosilalisasi oleh UPMF terkait dengan pemaparan berkas SPMI yang harus dilengkapi oleh program studi, pendampingan dalam proses penginputan, dan membantu program studi dalam menyelesaikan masalah dan hambatan yang dihadapi pada proses penginputan.', 'FRS', 'mei', '500000', '', NULL, NULL, NULL, '2024'),
