(467, 15, 'IKU 3', 'FRS-012', 'program', 'Monitoring dan Evaluasi Prodi', 'Kegiatan ini bertujuan untuk melihat sejauh mana ketercapain prodi terhadap IKU dan IKT yang direncanakan, serta mengevaluasi ketidaktercapaian', 'Ruang Rapat FRS Lantai 1', 'mei', '1000000', 'Monitoring dan Evaluasi diperlukan sebagai bentuk peningkatan manajeman mutu yang baik, hal ini bertujuan sebagai bentuk peningkatan nilai akreditasi program studi teknik elektro kedepannya. adanya kegiatan ini juga memberikan informasi terkait  pembelajaran, penelitian dan pengabdian di program studi', NULL, NULL, NULL, '2024'),
(468, 15, 'Sharing Shasion 1', 'FRS-013', 'program', 'Industrial Sharing Shassion', 'Kegiatan ini merupakan wadah diskusi tentang hibah penelitian dosen, pengabdian masyarakat, dan keminatan (sesuai roadmap penelitian dan pengabdian) di Teknik Industri kepada mahasiswa agar mahasiswa ikut serta dalam riset dosen', 'Teknik Industri', 'mei', '250000', 'Sekprodi', NULL, NULL, NULL, '2024'),
(469, 15, 'Lulusan Mendapatkan Pekerjaan yang Layak', 'FRS-014', 'program', 'Iuran Anggota Tetap BKS-TM', 'Kewajiban anggota tetap Badan Kerjasama Teknik Mesin se Indonesia adalah membayar iuran tahunan. Oleh karena itu perlu dilakukan pembayaran iuran tersebut untuk tahun 2024 sebesar Rp. 2.000.000,-', 'UTS', 'mei', '2000000', '', NULL, NULL, NULL, '2024'),
(470, 15, 'Hasil Kerja Dosen Digunakan Oleh Masyarakat Atau Mendapat Rekognisi Internasional', 'FRS-015', 'pengadaan', 'Pembayaran DOI', 'igital Object Identifier (DOI) merupakan alamat unik sebagai pengenal suatu dokumen elektronik yang berisifat permanen. DOI digunakan sebagai alamat unik untuk setiap makalah yang terbit di Jurnal GEAR', 'UTS', 'mei', '340000', '', NULL, NULL, NULL, '2024'),
(471, 15, 'Persentase program studi yang melaksanakan kerjasama dengan mitra', 'FRS-016', 'program', 'Kerjasama fakultas dengan industri untuk implementasi MBKM dan sejenisnya', 'Kerjasama FRS dengan industri ditujukan untuk meningkatkan kualitas pembelajaran dengan menggabungkan teori dan praktik, memberikan kesempatan kepada mahasisa untuk mendapatkan pengelaman kerja sehingga menjadi lulusan yang siap kerja dan memberikan kesempatan kepada dosen untuk penelitian maupun pengabdian. Targe dari program kerjasama menghasilkan minimal  5 kerjasama dengan industri.', 'Industri terkait', 'juni', '4000000', '', NULL, NULL, NULL, '2024'),
