(473, 15, 'Kemahasiswaa', 'FRS-018', 'program', 'Kegiatan Himpunan Program Studi di lingkungan Fakultas Rekayasa Sistem - Termin 1 (Informatiaka, Teknik Mesin, Teknik Elektro)', 'Menyelenggarakan kegiatan yang menunjang pengembangan minat dan bakat mahasiswa himpunan mahasiswa program studi dan membangun rasa kekeluargaan serta solidaritas mahasiswa. Program ini dilakuakn setiap semester oleh 5 himpunan mahasiswa dengan pencairan setiap termin.', 'Prodi', 'juni', '3000000', '', NULL, NULL, NULL, '2024'),
