(476, 15, 'Jumlah program studi dengan akreditasi Baik Sekali', 'FRS-021', 'program', 'Uji Publik Kurikulum FRS', 'Uji Publik Kurikulum Fakultas Rekayasa Sistem (FRS) merupakan kegiatan yang bertujuan untuk mendapatkan masukan dari publik (eksternal) terhadap kurikulum program studi di lingkungan FRS meliputi Teknik Elektro, Teknik Mesin, Teknik Industri, Teknik Sistem Energi dan Informatika', 'Luar Kampus', 'juli', '7000000', '', NULL, NULL, NULL, '2024'),
(477, 15, 'Persentase mahasiswa yang menghabiskan 20 SKS di luar kampus', 'FRS-022', 'program', 'Sosilialisasi Program MBKM', 'Sosialisasi Program MBKM di lingkungan Fakultas Rekayasa Sistem ditujukan untuk memberikan informasi lengkap terkait MBKM, meningkatkan pemahaman dan minat mahasiswa untuk mengikuti program MBKM,  serta terciptanya mahasiswa kreatif, inovatif, dan berdaya saing.', 'RPK', 'juli', '1000000', '', NULL, NULL, NULL, '2024'),
(478, 15, 'Kemahasiswaa', 'FRS-023', 'program', 'Kegiatan Himpunan Program Studi di lingkungan Fakultas Rekayasa Sistem - Termin 1 (Teknik Industri dan TSE)', 'Menyelenggarakan kegiatan yang menunjang pengembangan minat dan bakat mahasiswa himpunan mahasiswa program studi dan membangun rasa kekeluargaan serta solidaritas mahasiswa. Program ini dilakuakn setiap semester oleh 5 himpunan mahasiswa dengan pencairan setiap termin.', 'Prodi', 'juli', '2000000', '', NULL, NULL, NULL, '2024'),
(479, 15, 'Rasio sitasi per dosen', 'FRS-024', 'program', 'Tabulasi jumlah citasi dosen (Setiap Semester dalam 1 tahun)', 'Jumlah citasi dosen mengacu pada berapa kali karya ilmiah dosen dikutip dalam karya ilmiah lain sehingga menjadi indikator produktivitas dan pengaruh terhadap penelitian dosen di linkungan FRS', 'FRS', 'agustus', '500000', '', NULL, NULL, NULL, '2024'),
(480, 15, 'Tingkat pencapaian nilai-nilai universitas', 'FRS-025', 'program', 'Pertemuan Rutin FRS 1 kali 1 bulan', 'Program pertemuan rutin FRS ditujukan seluruh dosen dan staff agar mendapatkan informasi terupdate terkait dengan hibah, aturan, maupun informasi lainnya yang relvan untuk kemajuan FRS.', 'FRS', 'agustus', '500000', '', NULL, NULL, NULL, '2024'),
(481, 15, 'Lulusan Mendapatkan Pekerjaan yang Layak', 'FRS-026', 'pengadaan', 'Pembelian Alat Praktikum untuk Pengambilan Data Lapangan Sumber Daya Energi', 'Upaya Peningkatan Kolaborasi Penelitian Ilmiah Mahasiswa dan Dosen. Detail pemeblian alat penelitian dan praktikum: (1) Anemometer Wind Speed Meter Sensor 1 pcs: Rp. 800.000; (2) Water flow meter sensor 1 pcs: Rp 1.500.000; (3) Solar light radiation meter sensor 1 pcs: Rp. 3.500.000; (4) Wood Sawdust Moistture Meter 1 pcs: Rp. 700.000; (5) Mastech thermocouple data logger 1 pcs; Rp 1.500.000', 'UTS', 'agustus', '8000000', '', NULL, NULL, NULL, '2024'),
(482, 15, 'Terimplementasinya sistem penjaminan mutu internal', 'FRS-027', 'program', 'AMI FRS setiap semestester yang dinilai dalam 1 tahun', 'AMI FRS merupakan program untuk meningkatkan mutu penyelenggaraan pendidikan, memastikan bahwa FRS telah memenuhi standar mutu yang ditetetapkan, dan memberikan masukan untuk perbaikan berkelanjutan terkait mutu di lingkungan FRS.', 'FRS', 'september', '1000000', '', NULL, NULL, NULL, '2024'),
