(732, 44, 'Non IKU', 'WR1-032', 'program', 'Kordinasi, perumusan dan pembuatan aneka bahan ajar untuk MKDU Agama, Kewarganegaraan, dan Bahasa Inggris ', 'tuntutan dalam mencapai kualitas pengajaran yang baik mengharuskan MKDU harus dapat menjamin hal tersebut, mulai dari menghasilkan bahan ajar yang sesuai standar dan capaian yang ingin dicapai. berdasarkan hal tersebut maka diperlukan kegiatan-kegiatan yang secara spesifik membahas hal tersebut, dengan melibatkan beberapa pihak yang digabung dalam satu tim adhoc. kegiatan yang dimaksud seperti FGD yang dibarengi dengan membedah bahan ajar atau RPS.    ', 'UTS', 'agustus', '3000000', '', NULL, NULL, NULL, '2024'),
