(741, 44, 'IKU 13', 'WR1-041', 'program', 'REWARD Pembimbing lolos pendanaan', 'Reward diberikan kepada Dosen pembimbing PKM yang berhasil meloloskan tim bimbingannya mendapatkan Dana. Reward ini diharapkan menjadi motivasi agar semakin banyaknya dosen yang membingbing PKM, Agar kreatifitas mahasiswa semakin meningkat', 'UTS', 'september', '7000000', '', NULL, NULL, NULL, '2024'),
(742, 44, 'IKU 31', 'WR1-042', 'pengadaan', 'Pembuatan sistem informasi akademik, kemahasiswaan dan SDM Termin II', 'Dalam rangka meningkatkan kualitas pembelajaran untuk menghasilkan lulusan sesuai dengan capaian pembelajaran maka perlu dibuatkan sebuah sistem monitoring dan evaluasi dalam pelaksanaan pembelajaran yang terintegrasi, mudah dan cepat serta terdokumentasi dengan baik.', 'UTS', 'oktober', '6000000', '', NULL, NULL, NULL, '2024'),
(743, 44, 'Non IKU', 'WR1-043', 'program', 'Sosialisasi Akademik ', 'Memperkenalkan proses alur KRS dan SOP akademik kepada mahasiswa secara visual melalui infografis. Memberikan informasi yang jelas dan mudah dipahami mengenai timeline akademik di awal semester.', 'UTS', 'oktober', '1500000', '', NULL, NULL, NULL, '2024'),
