(29, 593, 6, 3, 10, 48, 'Dalam melaksanakan pengembangan dan pembentukan karakter di suatu lembaga perlu adanya manajemen yang diharapkan mampu melakukan perencanaan kegiatan, melaksanakan kegiatan dengan variasi lain guna meningkatkan performa  kegiatan yang didalamnya memuat nilai-nilai karakter. Maka dengan ini kami mengadakan Pembinaan karakter dengan metode lain dari selain melingkar dengan kelompoknya masing-masing.', 'Bpk. Win Ariga', 'Seluruh Mentor 2023', '1. Pembukaan\r\n2. Sambutan\r\n3. Materi \r\n4. Games\r\n5. Pembagian Reward\r\n6. Penutup', 'Pantai Ai Lemak', NULL, '2400000', '[{\"item\":\"Sewa tempat\",\"qty\":\"1\",\"harga_satuan\":\"300000\",\"total\":\"300000\",\"detail\":null},{\"item\":\"Reward Mentor\",\"qty\":\"4\",\"harga_satuan\":\"50000\",\"total\":\"200000\",\"detail\":null},{\"item\":\"Konsumsi Peserta dan Panitia\",\"qty\":\"90\",\"harga_satuan\":\"10000\",\"total\":\"900000\",\"detail\":null},{\"item\":\"Snack Pemateri dan tamu\",\"qty\":\"5\",\"harga_satuan\":\"15000\",\"total\":\"75000\",\"detail\":null},{\"item\":\"Snack peserta\",\"qty\":\"90\",\"harga_satuan\":\"5000\",\"total\":\"450000\",\"detail\":null},{\"item\":\"Banner\",\"qty\":\"1\",\"harga_satuan\":\"200000\",\"total\":\"200000\",\"detail\":null},{\"item\":\"Sewa pickup\",\"qty\":\"1\",\"harga_satuan\":\"250000\",\"total\":\"250000\",\"detail\":null},{\"item\":\"Baterai mic\",\"qty\":\"1\",\"harga_satuan\":\"25000\",\"total\":\"25000\",\"detail\":null}]', '0', NULL, 0, 0, NULL, '2024-04-20 22:51:35', '2024-04-20 22:51:35', NULL);
